import React from 'react';

export default function House(props) {

  return (

      <div className=" p-3 rounded-lg flex flex-row sm:columns-3xs  border hover:shadow-lg ease-linear transition-all duration-150">
         <div className="flex flex-col w-full sm:w-fit text-center sm:text-start mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2">
        <div className="flex max-w-4/12">
          <picture className="max-w-[500px] aspect-square m-2">
            <img
              src={`${props.url}`}
              loading="lazy"
              className="w-full h-full rounded-full shadow-lg object-cover"
            />
          </picture>
        </div>
        </div>
        <div className="flex flex-col w-full sm:w-fit text-center sm:text-start mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2">
            <div className="text-xl md:text-2xl font-medium">{props.name}</div>
            <div className="multiline-ellipsis text-md md:text-lg font-normal">{props.intro}</div>
            <div className="text-md md:text-lg font-normal">{props.score.toFixed(1)}</div>
            <div className="text-md md:text-lg font-normal">台北市</div>
            <div className="text-md md:text-lg font-normal">{props.price}</div>
        </div>


        <div>
      <FormControl sx={{ m: 1, width: 300 }}>
        <InputLabel id="demo-multiple-name-label">Name</InputLabel>
        <Select
          labelId="demo-multiple-name-label"
          id="demo-multiple-name"
          multiple
          value={personName}
          onChange={handleChange}
          input={<OutlinedInput label="Name" />}
          MenuProps={MenuProps}
        >
          {names.map((name) => (
            <MenuItem
              key={name}
              value={name}
              style={getStyles(name, personName, theme)}
            >
              {name}
            </MenuItem>
          ))}
        </Select>
      </FormControl>
    </div>
      </div>
  );
}
